  true,\n\t\"url\": null,\n\t\"notes\": \"The Special Nutrition Program Operations
  Study is a multiyear study designed to provide the Food and Nutrition Service with
  a snapshot of current State and School Food Authority policies and practices, including
  information on school meal standards, competitive foods standards, professional
  standards, school lunch pricing and accounting, and standards for school wellness
  policies. The information in this first year study (School Year 2011-12) will provide
  a baseline for observing the improvements resulting from the implementation of the
  Healthy, Hunger-Free Kids Act.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
